import React from "react";
import {
  List,
  Datagrid,
  TextField,
  EditButton,
  DeleteButton,
  DateField,
} from "react-admin";

const postRowClick = (id, resource, record) => "show";

const PrinterList = (props) => {
  return (
    <List {...props}>
      <Datagrid rowClick={postRowClick}>
        <TextField source="printerId" label="Printer name" />
        <TextField source="regionId" label="Region Name" />
      </Datagrid>
    </List>
  );
};

export default PrinterList;
